text = ""

def numberCode(text, num):
    if num == 0: 
        text = text.replace("6357", "0")
    elif num == 1:
        text = text.replace("1768", "1")
    elif num == 2:
        text = text.replace("3048", "2")
    elif num == 3:
        text = text.replace("1416", "3")
    elif num == 4:
        text = text.replace("6655", "4")
    elif num == 5:
        text = text.replace("5946", "5")
    elif num == 6:
        text = text.replace("9484", "6")
    elif num == 7:
        text = text.replace("5056", "7")
    elif num == 8:
        text = text.replace("4050", "8")
    elif num == 9:
        text = text.replace("3425", "9")

    return text


